#
# Trigger "remove_user"
#

DROP TRIGGER IF EXISTS `remove_user`;
CREATE TRIGGER `remove_user` BEFORE DELETE ON `usuarios` FOR EACH ROW BEGIN
    DELETE FROM professores WHERE id_professor=OLD.id_usuario;
    DELETE FROM alunos WHERE id_professor=OLD.id_usuario;
    
    DELETE FROM alunos WHERE id_aluno=OLD.id_usuario;
    
    /*DELETE FROM solicitacoes_academicas where solicitacoes_academicas.id_usuario=OLD.id_usuario*/
END;
